/**
 * @param {string[]} words
 * @return {number[][]}
 */
var palindromePairs = function(words) {
  var res = [], len = words.length, word, start, end;
  var iStart = {}, iEnd = {}, iAll = {};
  for (var i = 0; i < len; i++) {
    word = words[i];
    start = word[0];
    end = word[word.length - 1];
    if (!iStart[start]) iStart[start] = [];
    if (!iEnd[end]) iEnd[end] = [];
    iStart[start].push(i);
    iEnd[end].push(i);
    iAll[start] = iAll[end] = null;
  }

  for (var ch in iAll)
    for (var i of iStart[ch] || [])
      for (var j of iEnd[ch] || [])
        if (i != j && isPalindrome(words[i] + words[j]))
          res.push([i, j]);

  return res;
};

function isPalindrome (str) {
  for (var i = 0, j = str.length - 1; i < j; i++, j--) {
    if (str[i] != str[j]) {
      return false;
    }
  }
  return true;
}

